_used_txids = set()

def _generate_unique_txid():
    while True:
        txid = ''.join(random.choices(string.ascii_uppercase + string.digits, k=8))
        if txid not in _used_txids:
            _used_txids.add(txid)
            return f'TX#{txid}'

def random_verification_line(symbol=None):
    all_lines = STOCK_VERIFICATIONS + CRYPTO_VERIFICATIONS + MEME_VERIFICATIONS
    line = random.choice(all_lines)
    if '{txid}' in line:
        line = line.replace('{txid}', _generate_unique_txid())
    return line

